import React, { useContext } from 'react';

// State
import { TodoContext } from "../context/TodoProvider";

// Comnponents
import AddTodo from "./AddTodo";

const List = props => {
    const { list } = useContext(TodoContext);
    return (
        <div className="list">
            <ul>
                <li>
                    <AddTodo />
                </li>
                {list.todos.map((item, i) => {
                    return (
                        <li key={i}>
                            <span>{item.task}</span>
                            <span>{item.date}</span>
                        </li>
                    );
                })}
            </ul>
        </div>
    );
}

export default List;
